    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE 84 + + col2 NOT BETWEEN + 86 * 42 + - col1 AND - - col0 AND ( 18 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q2150.out
    data: |
      51	14	96
      85	5	59
      91	47	68
